River Monsters Series 3

Nature, Travel Documentary hosted by Jeremy Wade, published by Discovery Channel in 2011 - English narration


Information
------------------------------

River Monsters Series 3
Jeremy Wade, biologist and extreme angler, is back with more investigations into the murky world of fishermen s tales. Jeremy investigates tales of frighteningly large and dangerous river monsters that have attacked and even killed humans. In this season, Wade catches the most bizarre and dangerous underwater creatures to inhabit earth, including a monster responsible for devouring certain male body parts in Papua New Guinea, and packs of eels that will rip the flesh from unfortunate swimmers. Jeremy s search for the truth takes him on a dark and dangerous journey across the globe to reveal that the truth is every bit as unbelievable as the myth.
&quot;Perhaps my favorite part about River Monsters is that the program is entirely aware of the dangers that exist outside of the water when traveling to different continents. Jeremy Wade is always very culturally aware, and often has to tread thin lines when investigating animals in extreme locations. He is always eager to seek local knowledge, respect tradition and utilize the assistance of the community. When speaking to those who have suffered loss or injury he is sympathetic, yet composed and persevering.&quot;




7)  Jungle Killer 
Jeremy Wade sets out to discover the true river monster of South America. Piranhas get all the press, but is there a more fearsome predator lurking in its rivers? Tipped off by an account of an attack on a diver, Jeremy soon discovers that there is a real monster to find. Tipped off by the local Amerindian tribe, Jeremy heads deeper and deeper into the remote jungles of Suriname to come face to face with a jungle killer like no other.


